/**
 * PEMDA DIY Dashboard - React App
 * Main Application Component
 */

import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Toaster } from 'react-hot-toast';
import keycloak from './keycloak';

// Pages
import Dashboard from './pages/Dashboard';
import Profile from './pages/Profile';
import Security from './pages/Security';
import Sessions from './pages/Sessions';
import Logs from './pages/Logs';
import Documents from './pages/Documents';
import Notes from './pages/Notes';
import Login from './pages/Login';
import Callback from './pages/Callback';

// Components
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import Loading from './components/Loading';
import ErrorBoundary from './components/shared/ErrorBoundary';

// Styles
import './styles/App.css';

function App() {
  // Development mode - bypass Keycloak if REACT_APP_DEV_MODE=true
  const isDev = process.env.REACT_APP_DEV_MODE === 'true';

  const [authenticated, setAuthenticated] = useState(isDev);
  const [loading, setLoading] = useState(!isDev);
  const [user, setUser] = useState(isDev ? {
    id: 'dev-user-001',
    username: 'developer',
    email: 'dev@pemda-diy.go.id',
    firstName: 'Developer',
    lastName: 'Mode',
    fullName: 'Developer Mode'
  } : null);

  useEffect(() => {
    // Skip Keycloak in development mode
    if (isDev) {
      console.log('ðŸš€ Running in DEVELOPMENT MODE - Keycloak disabled');
      return;
    }

    // Initialize Keycloak
    keycloak.init({
      onLoad: 'check-sso',
      pkceMethod: 'S256',
      checkLoginIframe: false // Disable iframe check to prevent timeout on localhost
    }).then(authenticated => {
      setAuthenticated(authenticated);

      if (authenticated) {
        // Load user profile
        keycloak.loadUserProfile().then(profile => {
          setUser({
            id: keycloak.tokenParsed.sub,
            username: keycloak.tokenParsed.preferred_username,
            email: profile.email,
            firstName: profile.firstName,
            lastName: profile.lastName,
            fullName: `${profile.firstName || ''} ${profile.lastName || ''}`.trim()
          });
        });
      }

      setLoading(false);
    }).catch(error => {
      console.error('Keycloak initialization error:', error);
      setLoading(false);
    });

    // Token refresh
    keycloak.onTokenExpired = () => {
      keycloak.updateToken(30).then(refreshed => {
        if (refreshed) {
          console.log('Token refreshed');
        }
      }).catch(() => {
        console.error('Failed to refresh token');
        keycloak.logout();
      });
    };
  }, [isDev]);

  const handleLogin = () => {
    keycloak.login({
      redirectUri: window.location.origin + '/callback'
    });
  };

  const handleLogout = () => {
    if (isDev) {
      console.log('Dev mode: Logout clicked');
      window.location.reload();
      return;
    }
    keycloak.logout({
      redirectUri: window.location.origin
    });
  };

  if (loading) {
    return <Loading />;
  }

  if (!authenticated) {
    return (
      <ErrorBoundary>
        <Router>
          <Routes>
            <Route path="/callback" element={<Callback />} />
            <Route path="*" element={<Login onLogin={handleLogin} />} />
          </Routes>
          <Toaster position="top-right" />
        </Router>
      </ErrorBoundary>
    );
  }

  return (
    <ErrorBoundary>
      <Router>
        <div className="dashboard-container">
          <Sidebar onLogout={handleLogout} />

          <main className="main-content">
            <Header user={user} />

            <Routes>
              <Route path="/" element={<Dashboard user={user} />} />
              <Route path="/profile" element={<Profile user={user} />} />
              <Route path="/security" element={<Security />} />
              <Route path="/sessions" element={<Sessions />} />
              <Route path="/logs" element={<Logs />} />
              <Route path="/documents" element={<Documents />} />
              <Route path="/notes" element={<Notes />} />
              <Route path="/callback" element={<Navigate to="/" replace />} />
              <Route path="*" element={<Navigate to="/" replace />} />
            </Routes>
          </main>
        </div>

        <Toaster position="top-right" />
      </Router>
    </ErrorBoundary>
  );
}

export default App;
